```sparql
SELECT ?bandMember ?personBornAsBirthName ?nativeOfAward 
WHERE {
  # Part 1: Band member of Bobby Shmurda's associated musical artist
  ?bobbyShmurda <http://dbpedia.org/property/associatedMusicalArtist> ?artist .
  ?artist <http://dbpedia.org/ontology/member> ?bandMember .
  FILTER EXISTS { ?bandMember <http://dbpedia.org/ontology/musicalArtist> [] }

  # Part 2: Person born as the birth name of the native, that is a musical artist, of Florida
  ?person <http://dbpedia.org/property/birthName> ?birthName .
  ?person <http://dbpedia.org/ontology/nativeOf> ?nativePlace .
  FILTER (STR(?nativePlace) = "Florida"@en)
  FILTER EXISTS { ?person <http://dbpedia.org/ontology/musicalArtist> [] }
  BIND(?birthName AS ?personBornAsBirthName)

  # Part 3: Native of the award, that is a region and American and a state and a settlement, of the awardee, that is a band, of New York (State)
  ?award <http://dbpedia.org/ontology/location> ?location .
  FILTER EXISTS { 
    VALUES ?type { "Region"@en "American"@en "State"@en "Settlement"@en }
    ?location <http://www.w3.org/2000/01/rdf-schema#label> ?type
  }
  ?band <http://dbpedia.org/ontology/nationality> <http://dbpedia.org/resource/New_York_(state)> .
  ?band <http://dbpedia.org/property/awardee> ?award .
  ?person2 <http://dbpedia.org/ontology/nativeOf> ?location .
  FILTER EXISTS { ?person2 <http://dbpedia.org/ontology/band> [] }
  BIND(?location AS ?nativeOfAward)
}
```

