  # Step 4: Reference to The Shadow's alter ego
  <http://dbpedia.org/resource/The_Shadow> <http://dbpedia.org/property/alterEgo> ?alterEgo .
  ?alterEgo <http://xmlns.com/foaf/0.1/name> ?alterEgoReference .
}
```

