  OPTIONAL { ?commander <http://dbpedia.org/ontology/country> ?country . }

  FILTER((BOUND(?title) && STRSTARTS(STR(?title), "King")) || (BOUND(?country) && STRSTARTS(STR(?country), "Royal")))

  # Step 3: Find parent of the commander who is royalty
  OPTIONAL { ?commander <http://xmlns.com/foaf/0.1/knows> ?parent . }
  OPTIONAL { ?commander <http://www.w3.org/ns/prov#wasDerivedFrom> ?parent . }

  # Check if the parent is royalty
  OPTIONAL { ?parent <http://dbpedia.org/property/title> ?parentTitle . }
  OPTIONAL { ?parent <http://dbpedia.org/ontology/country> ?parentCountry . }

  FILTER((BOUND(?parentTitle) && STRSTARTS(STR(?parentTitle), "King")) || (BOUND(?parentCountry) && STRSTARTS(STR(?parentCountry), "Royal")))

  # Step 4: Find child of the parent
  OPTIONAL { ?parent <http://dbpedia.org/ontology/birthParent> ?child . }
}
